import React from 'react';
import { BrowserRouter as Router, Switch, Route, Redirect, Link } from 'react-router-dom';
import Cookies from 'js-cookie';

import Header from './components/Header';
import About from './components/About';
import Register from './components/Register';
import ContactUs from './components/ContactUs';
import Dashboard from './components/Dashboard';
import Profile from './components/Profile';
import LoginForm from './components/LoginForm';

// Placeholder components for new routes
// You will replace these with your actual components
const UploadDocuments = () => (
  <div>
    <Header />
    <div style={{ padding: '40px', textAlign: 'center' }}>
      <h2>Upload Documents Page</h2>
      <p>This is where you can upload your tax-related documents.</p>
      <Link to="/dashboard">Back to Dashboard</Link>
    </div>
  </div>
);

const TaxCalculator = () => (
  <div>
    <Header />
    <div style={{ padding: '40px', textAlign: 'center' }}>
      <h2>Tax Calculator Page</h2>
      <p>Calculate your estimated tax liability here.</p>
      <Link to="/dashboard">Back to Dashboard</Link>
    </div>
  </div>
);

const Support = () => (
  <div>
    <Header />
    <div style={{ padding: '40px', textAlign: 'center' }}>
      <h2>Get Support Page</h2>
      <p>Contact our support team for assistance.</p>
      <Link to="/dashboard">Back to Dashboard</Link>
    </div>
  </div>
);


const App = () => {
  const isAuthenticated = () => {
    return Cookies.get('jwt_token') !== undefined;
  };

  const Home = () => (
    <div>
      <Header />
      <div style={{ padding: '40px', textAlign: 'center' }}>
        <h1>Welcome to Garuda AI Tax Assistant!</h1>
        <p>Your intelligent companion for effortless and optimized tax filing.</p>
        <p>
          {isAuthenticated() ? (
            <span>You are logged in! Go to your <Link to="/dashboard">Dashboard</Link>.</span>
          ) : (
            <span>Please <Link to="/login">login</Link> or <Link to="/api/register">register</Link> to get started.</span>
          )}
        </p>
      </div>
    </div>
  );

  return (
    <Router>
      <Switch>
        {/* Public Routes */}
        <Route exact path="/" component={Home} />
        <Route path="/login" component={LoginForm} />
        <Route path="/api/register" component={Register} />
        <Route path="/contact" component={ContactUs} />
        <Route path="/about" component={About} />

        {/* Protected Routes */}
        <Route
          path="/dashboard"
          render={(props) => (
            isAuthenticated() ? <Dashboard {...props} /> : <Redirect to="/login" />
          )}
        />
        <Route
          path="/profile"
          render={(props) => (
            isAuthenticated() ? <Profile {...props} /> : <Redirect to="/login" />
          )}
        />
        {/* NEW: Routes for Dashboard Quick Actions */}
        <Route
          path="/upload-documents"
          render={(props) => (
            isAuthenticated() ? <UploadDocuments {...props} /> : <Redirect to="/login" />
          )}
        />
        <Route
          path="/tax-calculator"
          render={(props) => (
            isAuthenticated() ? <TaxCalculator {...props} /> : <Redirect to="/login" />
          )}
        />
        <Route
          path="/support"
          render={(props) => (
            isAuthenticated() ? <Support {...props} /> : <Redirect to="/login" />
          )}
        />

        {/* Catch-all route */}
        <Redirect to="/" />
      </Switch>
    </Router>
  );
};

export default App;
